export let styleFunctionAgrEdge = function (feature, flag) {
    // let icon = feature.get('iconUrl');
    let name = feature.get('name');
    let layerId = feature.get('layerId');
    let geometry = feature.getGeometry();
    let typeIcon = feature.get('type');
    let style, styleL;
    let srcIcon;
    // console.log(icon);
    //console.log(flag)
    if (layerId === 143771118) {
      if (name === "Edge") {
        styleL = new Style({
          stroke: new Stroke({
            color: 'rgb(55, 121, 188)',
            width: 2,
          })
        })
      }
      else if (name === "MG") {
        styleL = new Style({
          stroke: new Stroke({
            color: 'rgb(67, 150, 232)',
            width: 1,
          })
        })
      }
      else if (name === "Branch") {
        styleL = new Style({
          stroke: new Stroke({
            color: 'rgb(5, 242, 242)',
            width: 0.4,
          })
        })
      }
  
      let styles = {
        'Point': style,
        'LineString': styleL,
      };
  
  
      return styles[feature.getGeometry().getType()];
    }
  };
