export let styleFunctionArrow = function (feature) {
  
    let name = feature.get('name');
    let geometry = feature.getGeometry();
  
    let styleArrow;
  
    if (name === "Edge") {
      let coordinates = geometry.getCoordinates();
      let start = coordinates[0];
      let end = coordinates[1];
      let dx = end[0] - start[0];
      let dy = end[1] - start[1];
      let rotation = Math.atan2(dy, dx);
  
      styleArrow = new Style({
        geometry: new Point(end),
        image: new Icon({
          // src: "data:image/png;base64,",
          // src: "E:/WORK/  ///react-func-openlayers-master/src/components/raw.svg",
          // src: 'data:image/png;base64,',
          src: 'data:image/png;base64,',
          // src: 'data:image/png;base64,',
          anchor: [1.25, 0.5],
          rotateWithView: true,
          scale: 0.3,
          rotation: -rotation,
        }),
      })
    } else if (name === "MG") {
  
      let coordinates = geometry.getCoordinates();
      let start = coordinates[0];
      let end = coordinates[1];
      let dx = end[0] - start[0];
      let dy = end[1] - start[1];
      let rotation = Math.atan2(dy, dx);
  
      styleArrow = new Style({
        geometry: new Point(end),
        image: new Icon({
          // src: "data:image/png;base64,",
          // src: "E:/WORK/  ///react-func-openlayers-master/src/components/raw.svg",
          // src: 'data:image/png;base64,',
          // src: 'data:image/png;base64,',
          src: 'data:image/png;base64,',
          anchor: [1.25, 0.5],
          rotateWithView: true,
          scale: 0.3,
          rotation: -rotation,
        }),
      })
  
    }
    else {
    }
    let styles = {
      'LineString': styleArrow,
    };
  
    return styles[feature.getGeometry().getType()];
  };
  
